import React, { useState, useEffect } from 'react';
import '../css/CoachDashboard.css'; // 砖砖 注爪 拽

const Dashboard = () => {
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const [data, setData] = useState(null);
  const [user, setUser] = useState(null);
  const [view, setView] = useState('roster');

  // 驻拽爪转 转转拽转 转 
  const manualLogout = () => {
    localStorage.clear();
    sessionStorage.clear();
    window.location.href = '/login';
  };

  useEffect(() => {
    let active = true; // 砖转 注转 注 驻

    const loadData = async () => {
      try {
        console.log("转 注转 转...");
        const token = localStorage.getItem('token');

        if (!token) {
          throw new Error(" 爪 拽 转专转 ( 转专 砖)");
        }

        const response = await fetch('http://localhost:5000/api/dashboard', {
          headers: { 
            'Content-Type': 'application/json',
            'Authorization': `Bearer ${token}` 
          }
        });

        // 驻 砖转 专砖 (401/403)
        if (response.status === 401 || response.status === 403) {
          throw new Error("驻 转拽祝 转专转 (403 Forbidden)");
        }

        //  砖 砖 专转 砖专转
        if (!response.ok) {
          const text = await response.text();
          throw new Error(text || "砖 转 砖专转");
        }

        // 爪 - 专 -JSON
        const json = await response.json();
        
        if (active) {
          console.log("转 转拽 爪:", json);
          setData({
             players: json.players || json.roster || [],
             proposals: json.proposals || []
          });
          setUser(json.user || { name: '专', role: 'unknown' });
          setLoading(false);
        }

      } catch (err) {
        console.error("砖 注:", err.message);
        if (active) {
          setError(err.message);
          setLoading(false); //  转 转 注  砖砖!
        }
      }
    };

    loadData();

    return () => { active = false; };
  }, []);

  // --- 转爪转 注 (注 驻转专 专 拽专 砖转拽注) ---
  if (loading) {
    return (
      <div className="coach-container" style={{textAlign: 'center', marginTop: '50px'}}>
        <h2>注 转...</h2>
        <br/>
        <button onClick={manualLogout} style={{background:'red', color:'white', padding:'10px'}}>
            转拽注? 抓  转转拽
        </button>
      </div>
    );
  }

  // --- 转爪转 砖 ( 专爪 - 注 住转) ---
  if (error) {
    return (
      <div className="coach-container" style={{textAlign: 'center', marginTop: '50px', color: 'red'}}>
        <h2>砖 注转 祝</h2>
        <h3>{error}</h3>
        <button onClick={manualLogout} className="btn-logout" style={{marginTop: '20px', padding: '10px 20px', fontSize: '18px'}}>
            专 祝 转专转 (Login)
        </button>
      </div>
    );
  }

  // --- 转爪 专砖转 (专拽   转拽) ---
  return (
    <div className="coach-container">
      <header className="coach-header">
        <div className="header-title">
             <h1>Mars Power Drive </h1>
             <span>专 : <strong>{user?.name}</strong></span>
        </div>
        <button onClick={manualLogout} className="btn-logout">转转拽</button>
      </header>

      {/* 专 转 */}
      <div className="content-area">
         {/* 驻转专  */}
         <div className="tabs-container">
            <button className={`tab-btn ${view==='roster'?'active':''}`} onClick={()=>setView('roster')}>住 砖拽</button>
            {user?.role === 'coach' && 
              <button className={`tab-btn ${view==='approvals'?'active':''}`} onClick={()=>setView('approvals')}>砖专</button>
            }
         </div>

         {/* 爪转 专砖 */}
         {view === 'roster' && (
           <div className="players-grid">
             {data.players.length > 0 ? data.players.map((p, i) => (
               <div key={i} className="player-card">
                 <strong>{p.name || p.userId?.fullName || '砖拽'}</strong>
               </div>
             )) : <p> 砖拽 爪</p>}
           </div>
         )}
         
         {/* 爪转 砖专 */}
         {view === 'approvals' && (
           <div>{data.proposals.length} 拽砖转 转转</div>
         )}
      </div>
    </div>
  );
};

export default Dashboard;
